function App() {
  return (
    <>
    <h1>
      <img
        src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcThDJiV9Y4dNo5lTD9Dgp3yof9b1bJe8ffFgatAJ5QkupApz_J3WU4u_5TZtuhNPaMekq4&usqp=CAU'
        alt='Happy Thanksgiving'
        className="header"
      />
    </h1>
    </>
  );
}

export default App;
